import { AnnotationOSDService } from '../../../annotation-osd/src/lib/annotation-osd.service';
import { MarkerPoly, MarkerRect, MarkerRound, } from '../../../annotation-osd/src/lib/annotation-osd.model';
import * as i0 from "@angular/core";
export class AppComponent {
    async ngOnInit() {
        let options = {
            style: {
                hover: {
                    fill: 'transparent',
                    cornerColor: 'red',
                    stroke: 'red',
                    opacity: 0.4,
                },
                active: {
                    fill: 'transparent',
                    cornerColor: 'pink',
                    stroke: 'pink',
                    opacity: 1,
                },
                neutral: {
                    fill: 'transparent',
                    cornerColor: 'red',
                    stroke: 'blue',
                    opacity: 1,
                },
            },
            selectable: true,
            hasBorders: false,
            transparentCorners: false,
            draggable: true,
            lockRotation: true,
            hasControls: true,
        };
        const player = new AnnotationOSDService(true);
        await player.playerFactory('image', 'player', 'https://www.auto-moto.com/wp-content/uploads/sites/9/2022/02/01-peugeot-208-750x410.jpg');
        player.addCanvas();
        //player.setHome({ point : { x : 0.2, y:0.5 }, width : 0.5, height: 0.5 });
        let deleteMarkerTest = true;
        const MarkerRound1 = new MarkerRound('MarkerRound1', options, 0.2, 0.6, 0.4);
        player.addMarker(MarkerRound1);
        const MarkerRound2 = new MarkerRound('MarkerRound2', options, 200, 200, 400, 'pixel');
        player.addMarker(MarkerRound2);
        const MarkerRect1 = new MarkerRect('MarkerRect1', options, 0.2, 0.2, 0.4, 0.4);
        player.addMarker(MarkerRect1);
        const MarkerRect2 = new MarkerRect('MarkerRect2', options, 200, 200, 400, 400, 'pixel');
        player.addMarker(MarkerRect2);
        const MarkerPoly1 = new MarkerPoly('MarkerPoly1', options, [{ x: 0, y: 0 }, { x: 0.2, y: 0.2 }, { x: 0, y: 0.7 }]);
        player.addMarker(MarkerPoly1);
        const MarkerPoly2 = new MarkerPoly('MarkerPoly2', options, [{ x: 0, y: 0 }, { x: 200, y: 200 }, { x: 110, y: 10 }], 'pixel');
        player.addMarker(MarkerPoly2);
        if (deleteMarkerTest)
            player.clear();
        // first draw rect percent
        player.setDrawMode({
            isDrawing: true,
            options: options,
            unit: 'percent',
            type: 'MarkerRect',
            data: { id: 'MarkerRectTest1' },
        });
        player.objectActions.subscribe((e) => {
            console.log('subscriber :: ', e);
            if (e.type === 'createMarker') {
                // @ts-ignore
                let cop = structuredClone(e.object);
                cop.id += 'Copy';
                cop.options.style.neutral.stroke = 'yellow';
                player.addMarker(cop);
                if (cop.type === 'MarkerRect' && cop.id === 'MarkerRectTest1Copy') {
                    // draw pixel rect
                    player.setDrawMode({
                        isDrawing: true,
                        options: options,
                        unit: 'pixel',
                        type: 'MarkerRect',
                        data: { id: 'MarkerRectTest2' },
                    });
                }
                if (cop.type === 'MarkerRect' && cop.id === 'MarkerRectTest2Copy') {
                    // draw percent round
                    player.setDrawMode({
                        isDrawing: true,
                        options: options,
                        unit: 'percent',
                        type: 'MarkerRound',
                        data: { id: 'MarkerRoundTest1' },
                    });
                }
                if (cop.type === 'MarkerRound' && cop.id === 'MarkerRoundTest1Copy') {
                    // draw pixel round
                    player.setDrawMode({
                        isDrawing: true,
                        options: options,
                        unit: 'pixel',
                        type: 'MarkerRound',
                        data: { id: 'MarkerRoundTest2' },
                    });
                }
                if (cop.type === 'MarkerRound' && cop.id === 'MarkerRoundTest2Copy') {
                    // draw pixel round
                    player.setDrawMode({
                        isDrawing: true,
                        options: options,
                        unit: 'pixel',
                        type: 'MarkerPoly',
                        data: { id: 'MarkerPolyTest1' },
                    });
                }
            }
        });
    }
}
